import { TIMESTAMP } from './../../util/timestamps';
import { Context } from './../../index';
import { Annotation } from '../../entities/Annotation';
import { Document } from '../../entities/Document';

const addAnnotation = async (p, args, context: Context) => {
  const contents = args.input.annotContents;
  const annot = await Annotation.create(args.input, 'Mutation.addAnnotation', context);

  const resolvedAnnot = await annot.resolveAsEntity();
  const document = await Document.buildFromId(
    resolvedAnnot.documentId,
    context?.user.id,
    'Mutation.addAnnotation',
    context
  );
  document.set('updatedAt', TIMESTAMP);
  await document.save();

  await document.publishEvent(context.pubsub, 'EDIT');
  await annot.publishEvent(context.pubsub, 'ADD');

  // handle message email
  if (context.emailOptions && context.emailOptions.emailOnAnnotationCreated) {
    const author = await annot.getCalculated('author');
    const members = await document.getResolvedMembers();

    context.emailManager.addToMessageEmailQueue({
      annotationId: resolvedAnnot.id,
      sendTo: members.map(member => member.user.email),
      sentBy: await author.get('email'),
      messageText: contents,
      documentId: resolvedAnnot.documentId,
      documentName: await document.get('name')
    });
  }
  return resolvedAnnot;
};

const editAnnotation = async (p, args, context: Context) => {
  const { id, input } = args;
  const annot = await Annotation.buildFromId(id, context?.user?.id, 'Mutation.editAnnotation', context);
  await annot.setMultiple(input);
  await annot.save(true);
  await annot.publishEvent(context.pubsub, 'EDIT');

  const resolvedAnnot = await annot.resolveAsEntity();
  context.emailManager.updateMessageTextInEmailQueue(id, resolvedAnnot.annotContents);
  return resolvedAnnot;
};

const deleteAnnotation = async (p, args, context: Context) => {
  const { id } = args;
  const annot = await Annotation.buildFromId(id, context?.user?.id, 'Mutation.deleteAnnotation', context);
  if(annot) {
    await annot.publishEvent(context.pubsub, 'DELETE');
    const deleteResult = await annot.delete(true);
    context.emailManager.deleteFromMessageEmailQueue(id);
    return deleteResult;
  } else {
    return {
      id,
      successful: false,
      message: 'Annotation not found'
    }
  }
};

export default { addAnnotation, editAnnotation, deleteAnnotation };
